import React from 'react';
import TextField from '@mui/material/TextField';
import SendIcon from '@mui/icons-material/Send';
import './textbox.css';

const MyTextBox = () => {
  return (
    <TextField
      className='box'
      multiline
      label="Enter Text"
      InputProps={{
        style: {
          color: 'white',
        // Adjust width considering the icon width
        },
        endAdornment: (
          <SendIcon
            style={{
              position: 'absolute',
              right: 8,
              cursor: 'pointer',
              pointerEvents: 'auto',
              color: 'white',
            }}
            onClick={() => {
              // Add functionality for handling the send action
              // For instance, you can add code here to send the text
              console.log('Sending...');
            }}
          />
        ),
      }}
    />
  );
};

export default MyTextBox;
